package main

import (
	"context"
	"fmt"
	"math/rand"
	"os"
	"os/signal"
	"sync"
	"syscall"
	"time"
)

func main() {
	const nConsumers = 2

	in := make(chan int, 10)
	p := Producer{&in}
	c := Consumer{&in, make(chan int, nConsumers)}
	go p.Produce()
	ctx, cancelFunc := context.WithCancel(context.Background())
	go c.Consume(ctx)
	wg := &sync.WaitGroup{}
	wg.Add(nConsumers)
	for i := 1; i <= nConsumers; i++ {
		go c.Work(wg, i)
	}
	termChan := make(chan os.Signal, 1)
	signal.Notify(termChan, syscall.SIGINT, syscall.SIGTERM)

	<-termChan

	cancelFunc()
	wg.Wait()
}

type Consumer struct {
	in   *chan int
	jobs chan int
}

func (c Consumer) Work(wg *sync.WaitGroup, i int) {
	defer wg.Done()
	for job := range c.jobs {
		fmt.Printf("Worker #%d start job %d\n", i, job)
		time.Sleep(time.Millisecond * time.Duration(3000+rand.Intn(3000)))
		fmt.Printf("Worker #%d finish job %d\n", i, job)
	}
	fmt.Printf("Worker #%d interrupted\n", i)
}

func (c Consumer) Consume(ctx context.Context) {
	for {
		select {
		case job := <-*c.in:
			c.jobs <- job
		case <-ctx.Done():
			close(c.jobs)
			fmt.Println("Consumer close channel")
			return
		}
	}
}

type Producer struct {
	in *chan int
}

func (p Producer) Produce() {
	task := 1
	for {
		*p.in <- task
		fmt.Printf("Send value %d\n", task)
		task++
		time.Sleep(time.Millisecond * 500)
	}
}

